issues.description:
Организация Горнолыжного курорта «Грибановка» предполагает ряд мероприятий по строительству и расширению канатных дорог современного оснащения, что максимально повысит качество и уровень сервиса предлагаемых услуг действующей инфраструктуры (http://www.gribanowka.ru/).
С увеличением потоков туристов возникает необходимость в специализированных средствах размещения до 400 человек, а также действующие предприятия питания, располагающиеся как в гостиницах, так и у подножья и вершины склона.
При расширение  Горнолыжного курорта «Грибановка» предполагается оказание обширного списка услуг:  
-Горнолыжный склон;
-Услуги канатных дорог;
-Услуги проката оборудования;
-Трасса беговых лыж;
-Услуги гостиничного комплекса;
-Услуги кафе, бара, ресторана;
-Детский спортивно оздоровительный лагерь;
-Туристические маршруты. 
В настоящем проекте предполагается создать горнолыжный курорт с соответствующей инфраструктурой с целью удовлетворения потребностей жителей Приморского края, других регионов Дальнего Востока и России, а также иностранных туристов в услугах зимнего отдыха и туризма.
Инфраструктура проекта: горнолыжная трасса общей протяженностью до 750 м; буксировочная канатная дорога производства СКАДО г. Самара; система искусственного оснежения склона; пункт проката спортивного снаряжения; теплое помещение для переодевания и приема пищи отдыхающих и персонала; места для отдыха на природе, парковка автомобилей.
Информация по развитию проекта: строительство четырех комплексов жилых индивидуальных домов блокированной застройки (всего 76 домов). Каждый дом предназначен для проживания одной семьи.

"Prim ring" is a project in the field of tourism, recreation and sports. Filling of the complex will allow to combine various events and cultural and entertainment programs, to spend time of active rest.

The Prim ring project is focused on domestic demand – Russian citizens and tourist flows of residents of the dynamically developing Asia-Pacific countries.

"The Prim ring" - it's:

• rolling karting;

• off-road driving attractions;

• venue for Russian and international drift competitions;

• motocross;

• paintball area ;

• children's town "Ringo Park»;

• picnic area and others.
